    function getColumnSortFunction(columns) {
        var len = columns.length;

        var columnSort = function(a, b) {
            for (var i = 0; i < len; i++) {
                var valueA = a[columns[i].columnName];
                var valueB = b[columns[i].columnName];

                if (valueA === valueB) {
                    continue;
                }

                if (columns[i].isAscending) {
                    return valueA > valueB ? 1 : -1;
                } else {
                    return valueA < valueB ? 1 : -1;
                }
            }
            // All equal
            return 0;
        };

        return columnSort;
    };

